import React from 'react'
import { Provider } from 'react-redux';
import { store } from '../../redux/store';
import Plp from './plp'
import mockData from '../../../cypress/mockData.json'

describe('<Plp />', () => {
  beforeEach(() => {
    cy.mount(
      <Provider store={store}>
        <Plp list = {mockData}/>
      </Provider>
    )
  })
  it('renders a list of products when given data', () => {
    cy.get('[data-testid="plp"]').should('have.length',20)
  })
})
